import React from "react";



function Item(props: any) {
    return ( 
        <div>
            <img src={props.img}/>
            <h5>{props.title}</h5>
            <p>{props.owner}</p>
            <p>{props.description}</p>
            <p>{props.likes}</p>
        </div>
     );
}

// HomeScreen (ItemView) -> ItemView (array Af items) -> Item
export default Item;
